// NavBar.js

import React from 'react';

function NavBar({ activeTab, setActiveTab, signOut }) {
  return (
    <nav className="navbar">
      <div>
        <button className={activeTab === 'view' ? 'active' : ''} onClick={() => setActiveTab('view')}>View Students</button>
        <button className={activeTab === 'upload' ? 'active' : ''} onClick={() => setActiveTab('upload')}>Upload Resume</button>
      </div>
      <button onClick={signOut}>Sign Out</button>
    </nav>
  );
}

export default NavBar;
